    layers; one for each unique LUST Status. There are a total of 289 features having
    a LUST status of "open", "closed with no residual contamination", or "closed
    with residual contamination". Additional attributes in this dataset contain facility
    name and locational information, status of LUST case, operating status of facility,
    inspection dates, and links to No Further Action letters for closed LUST cases.
